{"id": 145, "id_crm": "", "status": "rascunho", "economia": "0.00", "descricao": null, "cliente_id": 66, "observacoes": "As partes ajustam que o serviço de Creators compreenderá:
I. A atuação de 01 (um) criador de conteúdo;
II. A produção de 04 (quatro) anúncios em vídeo, sendo 02 (dois) roteiros desenvolvidos com 02 (duas) variações de ganchos;
