{"id": 62, "nome": "Único", "ativo": 1, "valor": "2500.00", "escopo": "Acompanhamento estratégico e operacional do projeto, com reuniões periódicas, acompanhamento de performance e suporte consultivo. O Account Manager atua como ponto focal entre a CONTRATANTE e as áreas técnicas da CONTRATADA, garantindo alinhamento, execução fluida e evolução constante das entregas.", "diretrizes": "i. Este módulo contempla a designação de um Account Manager responsável por acompanhar o desempenho geral do projeto, realizar cobranças de tarefas, propor caminhos estratégicos e apoiar a CONTRATANTE em decisões táticas relacionadas ao marketing e operação digital.

ii. Estão incluídas neste módulo:

Reuniões semanais de acompanhamento, com duração média de até 1h;

Produção de ata e plano de ação após cada reunião;

Monitoramento verbal e suporte por canal de comunicação oficial (como WhatsApp ou e-mail);

Apoio na priorização de demandas e repasse para as equipes de execução;

Acompanhamento de métricas-chave e status das entregas dos módulos contratados.

iii. O Account Manager não é responsável pela execução técnica das demandas, mas pela coordenação, comunicação e acompanhamento de resultados junto às equipes especializadas.

iv. O escopo inclui o suporte estratégico e verbal, sem produção de relatórios analíticos ou dashboards específicos — salvo quando já contratados em módulos próprios.

v. O atendimento será realizado durante o horário comercial, com tempo médio de resposta de até 48h úteis.", "servico_id": 34, "data_cadastro": "2025-11-25 19:00:47", "data_atualizacao": "2025-11-25 19:03:36"}

