{"id": 534, "id_crm": "17173", "status": "rascunho", "economia": "0.00", "descricao": null, "cliente_id": 266, "observacoes": "Condições Comerciais Especiais e Estrutura de Pagamento Inicial

Fica ajustado entre as partes que, em caráter excepcional e promocional, será concedido à CONTRATANTE um desconto no valor de R$ 2.000,00 (dois mil reais) sobre o valor mensal originalmente contratado de R$ 28.991,00 (vinte e oito mil, novecentos e noventa e um reais), aplicável exclusivamente às três primeiras mensalidades do contrato, resultando no valor base promocional de R$ 26.991,00 (vinte e seis mil, novecentos e noventa e um reais) para cada uma dessas mensalidades.

Adicionalmente, as partes acordam que a primeira mensalidade será paga no valor reduzido de R$ 18.991,00 (dezoito mil, novecentos e noventa e um reais). A diferença entre o valor base promocional da mensalidade (R$ 26.991,00) e o valor efetivamente pago na primeira mensalidade (R$ 18.991,00), correspondente ao montante de R$ 8.000,00 (oito mil reais), será integralmente redistribuída e acrescida às segunda e terceira mensalidades, na proporção de R$ 4.000,00 (quatro mil reais) adicionais em cada uma.

Dessa forma, para fins de total transparência e clareza, as mensalidades iniciais ficarão assim definidas:

1ª mensalidade: R$ 18.991,00 (dezoito mil, novecentos e noventa e um reais);

2ª mensalidade: R$ 30.991,00 (trinta mil, novecentos e noventa e um reais), correspondente ao valor base promocional de R$ 26.991,00 acrescido de R$ 4.000,00;

3ª mensalidade: R$ 30.991,00 (trinta mil, novecentos e noventa e um reais), correspondente ao valor base promocional de R$ 26.991,00 acrescido de R$ 4.000,00.

A partir da quarta mensalidade, o contrato passará a vigorar automaticamente pelo valor integral originalmente pactuado, qual seja, R$ 28.991,00 (vinte e oito mil, novecentos e noventa e um reais), sem novos descontos ou diluições, salvo se houver novo ajuste formal e expresso entre as partes, devidamente documentado por escrito.", "valor_total": null, "data_criacao": "2025-12-22 11:55:04", "data_cadastro": "2025-12-22 11:55:04", "fornecedor_id": null, "comercial_nome": null, "hash_documento": null, "url_assinatura": null, "usuario_fatura": null, "valor_original": "0.00", "assinafy_status": null, "comercial_cargo": null, "comercial_email": null, "met_cob_pontual": "", "numero_contrato": "CT-000415", "usuario_criacao": 16, "valor_negociado": "0.00", "data_atualizacao": "2025-12-22 11:55:04", "comercial_empresa": null, "signature_sent_at": null, "assinafy_last_sync": null, "comercial_telefone": null, "data_ultima_fatura": null, "documento_assinado": null, "met_cob_recorrente": "", "signature_provider": null, "status_faturamento": "pendente", "assinafy_upload_url": null, "desconto_percentual": "0.00", "usuario_atualizacao": null, "assinafy_document_id": null, "assinafy_signing_url": null, "data_inicio_pontuais": null, "signature_external_id": null, "signature_completed_at": null, "usuario_responsavel_id": 16, "data_inicio_recorrentes": null, "assinafy_signed_document_url": null, "data_inicio_cobranca_pontuais": null, "data_inicio_cobranca_recorrentes": null}

